import React from 'react';
import Tilt from 'react-tilt'
import './Logo.css';
import'tachyons';
const Logo = () => {
	return(
		<div>
		<Tilt className="Tilt br2 shadow-2" options={{ max : 55 }} style={{ height: 150, width: 150 }} >
 <div className="Tilt-inner"><div>Icons made by <a href="https://www.flaticon.com/authors/freepik" title="Freepik">Freepik</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div></div>
</Tilt>
		</div>
		);
}
export default Logo;
